<body class="h-full min-h-screen bg-gray-200 flex flex-col" x-data="alpineInstance()">
    <div class="h-full text-gray-800 p-4 lg:p-4 flex-1 flex flex-col items-center">
        <div class="w-full flex justify-center pb-2 text-lg font-semibold">
            Pavia - NO Bundles
        </div>
        <div class="flex items-center">
            <div class="flex flex-col">
                <div class="pb-3">
                    <input type="text" name="walletSearch" x-model="walletSearch"

                </div>

                <button type="submit" @click="loadData()"
                    class=" bg-blue-600 text-white font-semibold py-2 rounded hover:bg-blue-700"
                    :class="[ isLoading ? 'opacity-50 cursor-not-allowed' : 'hover:bg-blue-700' ]" :disabled="isLoading">
                    Search
                </button>

            </div>
        </div>
        
        <div class="w-full flex justify-center text-gray-600  text-sm">
            <div x-show="isLoading" class="pr-1">Downloading page:</div>
            <div x-show="isLoading" x-text="pageNum"></div>
        </div>
        <div class="w-full flex justify-center text-gray-600  text-sm">
            Downloading takes about 2-3minutes
        </div>
        <div>
            <div x-show="isError">

            </div>
        </div>

    </div>
    <svg id="scatterplot" width="2191" height="1162" class="hidden"></svg>

<script>
    function alpineInstance() {
        return {
            isLoading: false,
            isError: false,
            error: '',
            all_lands: [],
            lands_num: '',
            my: [],
            pageNum: 1,
            walletSearch: localStorage.getItem("address") || '',

            async loadData(){
                localStorage.setItem('address', this.walletSearch);
                this.pageNum = 1;
                this.isLoading = true;
                this.all_lands = [];
                this.lands_num = '';
                this.my = [];
                this.mySecond = [];
                this.actualBatchLength = 0;

                while(1){
                    try {
                        const response = await axios.get(`https://server.jpgstoreapis.com/policy/4bf184e01e0f163296ab253edd60774e2d34367d0e7b6cbc689b567d/listings?page=${this.pageNum}`)
                        
                        let lands = [...response.data];
                        if(lands.length == 0) break;
            
                        lands.forEach(land => {
                            if(land['listing_type'] === 'SINGLE_ASSET'){
                                let reversed_name = land['display_name'].split(' ').reverse()
                                this.all_lands.push({
                                    x: reversed_name[1],
                                    y: reversed_name[0],
                                    'price': land['price_lovelace'] / 1000000,
                                    'id': land['asset_id']
                                });
                            }
                        });

                        this.pageNum += 1;

                        await new Promise(resolve => setTimeout(resolve, 2000));
                    
                    } catch (err) {
                        this.isError = true;
                        // this.error = err;
                        // console.log(err);
                        this.error = 'Something went wrong :(';
                        break;
                    }
                }

                if (this.walletSearch != ''){        
                    await axios.get(`https://pool.pm/wallet/${this.walletSearch}`, {timeout: 10000})
                    .then((res) => {
                        tokens = [...res.data.tokens];
                        lands = tokens.filter(land => { return land.policy === '4bf184e01e0f163296ab253edd60774e2d34367d0e7b6cbc689b567d' });

                        lands.forEach(land => {
                            if ('-----Land Sale 3-----' in land.metadata){
                                let my_x = land.metadata['-----Land Sale 3-----'][1].x;
                                let my_y = land.metadata['-----Land Sale 3-----'][2].y;
                                this.my.push({x: my_x, y: my_y});
                            }
                            else {
                                let my_x = land.metadata['-----Land Sale 1-----'][1].x;
                                let my_y = land.metadata['-----Land Sale 1-----'][2].y;
                                this.my.push({x: my_x, y: my_y});
                            }
                        });
                    })
                    .catch((err) => {
                        console.log("Error: ", err);
                        this.isError = true;
                        this.error = 'Something went wrong :(';
                    });
                }

                this.isLoading = false;
                this.lands_num = this.all_lands.length.toString();
                this.plotData();
                var element = document.getElementById("scatterplot");
                element.classList.remove("hidden");

            },

                var g = svg.append("g")

                    .data(this.all_lands)
                    .enter()
                    .append("a")
                    .attr("target","_blank", function(d) { return "https://www.jpg.store/asset/" + d.id })
                    .attr("xlink:href", function(d) {return "https://www.jpg.store/asset/" + d.id})
                    .append("circle")

                    .attr("r", 2.3)
                    .attr("transform", "translate(" + 100 + "," + 100 + ")")
                    .style("fill", "#329431")
                    .on('mouseover', function(d) {
                        d3.select('#tooltip').transition().duration(200).style('opacity', 1).style('display', "block").text("x:" + d.x.toString() + " y:" + d.y.toString() + " price:" + d.price.toString()); 
                        d3.select(this).style("cursor", "default"); 
                    })
                    .on('mouseout', function() { 
                        d3.select('#tooltip').style('opacity', 0).style('display', "none"); 
                        d3.select(this).style("cursor", "default");
                    })
                    .on('mousemove', function() {
                        d3.select('#tooltip').style('left', (d3.event.pageX+10) + 'px').style('top', (d3.event.pageY+10) + 'px'); 
                        d3.select(this).style("cursor", "default");
                    });

                    .selectAll("dot")
                    .data(this.my)
                    .enter()
                    .append("circle")
                    .attr("cx", function (d) { return xScale(d.x); } )

                // my second
                svg.append('g')

                    .append("circle")
                    .attr("cx", function (d) { return xScale(d.x); } )
